import axios from "axios";

const queryPokemon = async (name) => {
    return await axios
        .get(`https://pokeapi.co/api/v2/pokemon/${name}`)
        .then((res) => {
            console.log("res23", res);
        })
        .catch((err) => console.log("err", err));
};

export default queryPokemon;
